import React from 'react'

export default function RoomItem(props) {
  
  const goToDeviceComp =() => {
    navigate('/roomname')
  }

  return (
    <div className={`roomItem ${props.room.rColor}`}  onClick={goToDeviceComp}>
      {props.room.rName}
    </div>
  )
}
